    # Si ce test échoue, alors votre fonction charger_contenu n'est pas valide.
    def test_charger_contenu(self):
        write_frmt:     str = 'w'
        test_frmt:      str = 't'
        err_msg:        str = "Votre fonction charger_contenu n'est pas valide."
        for i in range(n_stubs):
            with open(os.getcwd() + path + result_frmt + str(i + 1) + frmt, write_frmt) as r:
                r.write(charger_contenu(os.getcwd() + path + test_frmt + str(i + 1) + frmt))

        for i in range(n_stubs):
            with open(os.getcwd() + path + result_frmt + str(i + 1) + frmt, read_frmt) as r:
                r_res = r.read()
            with open(os.getcwd() + path + test_frmt + str(i + 1) + frmt, read_frmt) as t:
                t_res = t.read()
            self.assertEqual(r_res, t_res, msg=err_msg)

