    # Si ce test échoue, alors votre fonction d'ajout de code mort n'est pas valide.
    def test_generer_code_mort(self):
        self.assertEqual(generer_code_mort([]), None, msg="Votre fonction d'ajout de code mort n'est pas valide. Vous ne vérifiez pas l'entrée de l'utilisateur.")

        def_buffer:         float       = 0.1
        n_iter_bound:       int         = 1000000
        dead_code_lst:      list[str]   = ['ch', 'ar', 'le', 's', 'd', 'el', 'afon', 'tain', 'e']
        expected_nones:     int         = n_iter_bound / 2
        expected_avg:       float       = expected_nones / len(dead_code_lst)
        dead_code_received: dict        = dict()
        
        for dead_code in dead_code_lst:
            dead_code_received[dead_code] = 0
        dead_code_received[None] = 0

        for _ in range(n_iter_bound):
            res = generer_code_mort(dead_code_lst)
            dead_code_received[res] += 1
        
        err_msg = "Votre fonction d'ajout de code mort n'est pas valide. Erreur avec les probabilités de 50% de retourner des None."
        self.assertGreater  (dead_code_received[None], expected_nones - expected_nones * def_buffer, msg=err_msg)
        self.assertLess     (dead_code_received[None], expected_nones + expected_nones * def_buffer, msg=err_msg)
        
        err_msg = "Votre fonction d'ajout de code mort n'est pas valide. Erreur avec les probabilités de 50% de retourner du code mort aléatoire."
        for key in dead_code_received.keys():
            if key is None: continue
            self.assertGreater  (dead_code_received[key], expected_avg - expected_avg * def_buffer, msg=err_msg)
            self.assertLess     (dead_code_received[key], expected_avg + expected_avg * def_buffer, msg=err_msg)

